A gift box containing high-value currency. 
When opened, it may randomly give you 60-200 Credit Tokens. 
The probability of getting 60 Credit Tokens is 5%; 
The probability of getting 90 Credit Tokens is 9%; 
The probability of getting 120 Credit Tokens is 18%; 
The probability of getting 150 Credit Tokens is 27%; 
The probability of getting 180 Credit Tokens is 23%; 
The probability of getting 200 Credit Tokens is 18%.

"Of course you'll gain more if you complete the plan with a surplus!"
Once progress is maxed, every additional 100 Mileages will grant 1 Surplus Goods Crate. When opening an Surplus Goods Crate, there is a high chance of obtaining Sardis Gold ×500, Combat Report ×500, Analysis Blueprint ×500, and a small chance of obtaining Collapse Piece ×50.
The chances of obtaining supplies are as follows:
Sardis Gold ×500: 32%;
Combat Report ×500: 32%;
Analysis Blueprint ×500: 32%;
Collapse Piece ×50: 4%.

